import React from 'react';
import Counter from "./Counter" 


interface TileProps{
    title:string
}
class Tile extends React.Component<TileProps>  {
    render() { 
        return ( 
            <div className="Tile" >
                <h1>{this.props.title}</h1>
                <div>
                    {this.props.children}
                </div>
                <Counter message="&hearts;:" />
            </div>
        )
    }
 }

 export default Tile
